async () => {

		if(vayIndFgnKycPoiUpload.files.length === 1) {
			await JSObjectIndFgnKYC.deleteIfFileExist('POI');
			await	QueryInsertIndFGN.run({ 
				docType: vayIndFgnKycPoiName.text, 
				docPathFilename: vayIndFgnKycPoiUpload.files[0].name
			});
			QueryIndFgnKycPoi.run();
		}

		if(vayIndFgnKycPoaUpload.files.length === 1) {
			await JSObjectIndFgnKYC.deleteIfFileExist('POA');
			await	QueryInsertIndFGN.run({
				docType:vayIndFgnKycPoaName.text,
				docPathFilename: vayIndFgnKycPoaUpload.files[0].name
			});
			QueryIndFgnKycPOA.run();
		}

		if(vayIndFgnKycPhotoUpload.files.length === 1) {
			await JSObjectIndFgnKYC.deleteIfFileExist('PHT');
			await QueryInsertIndFGN.run({
				docType: 'IndividualForeignPhoto',
				docPathFilename: vayIndFgnKycPhotoUpload.files[0].name
			});
			QueryIndFgnKycPhoto.run();
		}

		showAlert('KYC Documents Uploaded');
		navigateTo('Individual KYC Summary', {});
	}

